text.text:
def longest(a1, a2):
    a = 'abcdefghijklmnopqrstuvwxyz'
    y = a1+a2
    n,i = '',0
    while i < len(a):
        x = 0
        while x<len(y):
            if a[i] == y[x]:
                n += a[i]
                x = len(y)

            x += 1
        i += 1
    return n

